import React from "react"

export default function InspireList(props) {

    console.log("inspirelist props", props)

    return (
        <div class="inspiration">
            <div>
                <blockquote>
                    <p>
                        {props.body}
                    </p>
                    <cite>
                        {props.author}
                    </cite> 
                </blockquote>
            </div>
        </div>
    )
}
